import React from 'react'
import { Form } from "semantic-ui-react";
import "./RegisterForm.scss";

export function RegisterForm() {
  return (
    <Form  className='register-form'>
        <Form name="email"  placeholder="E-mail" />
        <Form name="password"  type="password"  placeholder="Senha" />
        <Form name="repeatPassword" type="password" placeholder="Confirmar senha" />
        
    </Form>
  )
}
